def nth_Fibonacci(n):
    if n <= 0:
        return "Invalid Input. Please input a positive integer."
    elif n == 1:
        return 1
    elif n == 2:
        return 1
    else:
        fib_1, fib_2 = 1, 1
        for _ in range(n - 2):
            fib_1, fib_2 = fib_2, fib_1 + fib_2
        return fib_2
